import './App.css';

const currentTitle = `The Move List`;
const title = <h1 className="App-title">{currentTitle}</h1>;

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {title}
        <a
          className="App-link"
          href="https://themoviedb.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          The Movie List
        </a>
      </header>
    </div>
  );
}

export default App;
